import React from "react";
import Avatar from "./Avatar";
import Details from "./Details";

function Card(props) {
  return (
    <div className="card">
      <div className="top">
        <h2 className="name">{props.name}</h2>
        <h4 className="name">{props.info}</h4>
        <Avatar image={props.image} />
      </div>
      <div className="bottom">
        <Details detailInfo={props.price} />

        <button type="button" className="btn btn-primary book-button" href="form.html">
          Book Now
        </button>
      </div>
    </div>
  );
}

export default Card;
